description:
Angel B. wants it, and she wants it right now. There's nothing finer than a woman who knows what she wants, unless it's a woman who knows how to make you want to give it to her. And Angel B. has that down to a science. She's got on the sexiest little outfit - tight panties and bra - and while reading on the bed, she gets approached by exactly what she craves - a big hard man. Eager to get going, she dives right in with her mouth, and then basically goes everywhere from there. You ready to give Angel B. everything she's after?
